import { isEmpty } from "lodash"
import { useRouter } from "next/router"
import { useEffect } from "react"

export default function Home({ localStorage }) {
  const router = useRouter()

  if (isEmpty(localStorage.getItem('isToken'))) {
    useEffect(() => {
      router.push('/login')
    })
  }

  return (
    <></>
  )
}
